import React from 'react';
import { Avatar, Card } from 'antd';

const UserProfile = () => {
  return (
    <Card
      actions={[
        <div key="twit">짹짹<br />0</div>,
        <div key="follo">짹짹<br />0</div>,
        <div key="">짹짹<br />0</div>,
      ]}
    >
      <Card.Meta avatar={<Avatar>H</Avatar>} title="hagrune" />
    </Card>
  );
};

export default UserProfile;
